import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import Header from './components/header';
import reportWebVitals from './reportWebVitals';
import LocalStore from './components/locatStores';
import ShopCategory from './components/shopCategory'
import ShopNearYou from './components/shopNearYou'
import CannabisBrands from './components/cannabisBrands'
import TopStrains from './components/TopStrains'
import Welcome from './components/Welcome'
import Travel from './components/'

ReactDOM.render(
  <React.StrictMode>
    {/* this is where all the components will be imported and rendered in */}
    <Header />
    <LocalStore/>
    <ShopCategory/>
    <ShopNearYou/>
    <CannabisBrands/>
    <TopStrains/>
    <Welcome/>
    <Travel/>
  </React.StrictMode>,
  document.getElementById('root')
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
